import React from 'react';
import { AppBar, Toolbar, Button, Box } from '@mui/material';
import { styled } from '@mui/system';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import baaMbooLogo from '../assets/mainlogo1.png';

const StyledAppBar = styled(AppBar)({
  backgroundColor: '#000000',
  boxShadow: '0 4px 12px rgba(0, 0, 0, 0.1)',
});

const StyledButton = styled(Button)({
  color: '#ffffff',
  position: 'relative',
  padding: '8px 16px',
  fontWeight: 500,
  textTransform: 'none',
  fontSize: '1rem',
  '&:hover': {
    color: '#ffffff',
    backgroundColor: 'transparent',
  },
  '&:after': {
    content: '""',
    position: 'absolute',
    width: '0',
    height: '2px',
    bottom: '0',
    left: '50%',
    backgroundColor: '#28b463',
    transition: 'width 0.3s ease, left 0.3s ease',
  },
  '&:hover:after': {
    width: '100%',
    left: '0',
  },
});

const CartButton = styled(Button)({
  color: '#ffffff',
  padding: '8px',
  minWidth: 'auto',
  '&:hover': {
    color: '#28b463',
    backgroundColor: 'transparent',
  },
});

const LogoImage = styled('img')({
  height: '40px',
  width: '200px',
  cursor: 'pointer',
});

const PageContainer = styled(Box)({
  maxWidth: '1440px',
  width: '100%',
  margin: '0 auto',
  padding: { xs: '0 15px', sm: '0 20px' },
});

const Navbar = () => {
  return (
    <StyledAppBar position="static">
      <PageContainer>
        <Toolbar sx={{ justifyContent: 'space-between', alignItems: 'center' }}>
          <Box>
            <a href="#home" style={{ textDecoration: 'none' }}>
              <LogoImage src={baaMbooLogo} alt="Baa M Boo Logo" />
            </a>
          </Box>
          <Box sx={{ flexGrow: 1, display: 'flex', justifyContent: 'center', gap: '30px' }}>
            <StyledButton href="#home">Home</StyledButton>
            <StyledButton href="#men">Men</StyledButton>
            <StyledButton href="#women">Women</StyledButton>
            <StyledButton href="#contact">Contact</StyledButton>
          </Box>
          <Box>
            <CartButton href="#cart">
              <ShoppingCartIcon sx={{ fontSize: '28px' }} />
            </CartButton>
          </Box>
        </Toolbar>
      </PageContainer>
    </StyledAppBar>
  );
};

export default Navbar;
